import {GET_QUESTION} from "./types";
import axios from "axios";

const setQuestions = questions => {
    return {
        type:GET_QUESTION,
        payload:questions
    }
}

export const fetchQuestions = dispatch => id =>{
    axios.get(`/question/${id}`).then(response => {
        dispatch(setQuestions(response.data))
    }).catch(error=>{

    });
}
